window.bookSummaryJSON = "<p>Froggy loves the library! When Froggy and Mom and Pollywogilina set out for the library, Froggy brings a wheelbarrow to hold all the books he plans to borrow. There are so many to choose from: dinosaur books! Books about Space Frog! Froggy is so excited that he forgets to use his indoor voice. </p> <p>Listeners will enjoy Froggy's antics, and so does Miss Otterbottom, the librarian. \"Come again soon, Froggy,\" she says. </p>"; 
